window.bookSummaryJSON = "<p><b>Soon to be a major motion picture directed by Denis Villeneuve, starring Timothée Chalamet, Josh Brolin, Jason Momoa, Zendaya, Rebecca Ferguson, Oscar Isaac, Javier Bardem, Dave Bautista, Stellan Skarsgård, and Charlotte Rampling. </b></p> <p>Set on the desert planet Arrakis, Dune is the story of the boy Paul Atreides, who would become the mysterious man known as Maud'dib. He would avenge the traitorous plot against his noble family - and would bring to fruition humankind's most ancient and unattainable dream.&nbsp;</p> <p>A stunning blend of adventure and mysticism, environmentalism and politics, <i>Dune </i>won the first Nebula Award, shared the Hugo Award, and formed the basis of what is undoubtedly the grandest epic in science fiction.&nbsp;</p> <p>Frank Herbert's death in 1986 was a tragic loss, yet the astounding legacy of his visionary fiction will live forever.&nbsp;</p>"; 
